	(231,'Yes','Country 1','Maybe','Yes','No','No',41,'No','Maybe','Don''t know','Maybe','Don''t know','Don''t know','No','Yes','No','No','Some of them','Rarely','Maybe','Yes','I found it difficult to answer all of the questions effectively as many of them would depend on the nature of the mental health issues as some seem more socially accepted than others. For some people telling your current supervisor that you have a history of bi-polar disorder might be easier than telling a potential employer that you have a history of compulsive gambling. They might both be bits of irrelevant information (past behavior and not indicators of future behavior). However western culture pushes us to appear as capable as possible to our supervisors in pursuit of excellence in our work. Providing information that could create a negative bias seems like a more genuine and yet more risky approach to the discussion.','Yes','500-1000','Male'),
