	(793,'Yes','Country 1','Yes','No','Some of them','Yes',35,'No','Yes','Yes','No','No','Very difficult','No','No','No','No','No','Sometimes','Maybe','Yes','I work for the state government. While things are slowly changing regarding covering mental health with state employees it''s just not something that is acceptable in this kind of strict environment so I have to be careful about what I say and how I say it. I often take mental health days but have to call in with a physical illness because mental health problems are not acceptable excuses for using sick leave.','No','100-500','Female'),
	(361,'No','Country 11','No','Yes','Yes','No',34,'Yes','Maybe','Don''t know','No','Don''t know','Somewhat difficult','No','No','Yes','Yes','Yes','Rarely','No','Yes',NULL,'Yes','26-100','male'),
	(842,'Yes','Country 1','No','Yes','Yes','No',31,'No','Maybe','Don''t know','Maybe','No','Somewhat difficult','No','Yes','Don''t know','Yes','Yes','Sometimes','No','Yes','I have been incredibly public about my own struggle in my own conversations and in social media insofar as how I can use my depression to raise awareness or help others. Because of that my employer - or any future employer - kind of knows by default. It''s not a secret. That said the downside of that openness is that I have no faith that I wouldn''t be discriminated against at a future job simply because the information is public. Likewise I worry I''m seen as less-than by my employer in some circumstances. Regerdless I don''t regret being public and raising awareness. My point is that even those of us who do publicly discuss the issue fear systemic retribution. ','No','100-500','Female'),
	(1252,'Yes','Country 1','Yes','Yes','No','No',29,'No','Maybe','Yes','No','No','Don''t know','Yes','Yes','No','Yes','Some of them','Sometimes','No','Yes',NULL,'Yes','100-500','male'),
	(875,'Don''t know','Country 1','Yes','Yes','No','No',30,'Yes','Maybe','Don''t know','No','Don''t know','Very difficult','No','Not sure','Don''t know','Yes','No','Sometimes','No','Yes','The main reason for the openness answers are because of an experience with my last employer. I felt I could trust my direct supervisor so I divulged information. It ended up spreading to more supervisors and eventually my coworkers. Supers highly suggested treatment but rushed things that shouldn''t have been rushed and I ended up being incorrectly treated in a psych ward and mentally scarred from the issue. I lost most of my desire to program due to the experience not to mention thousands of dollars I lost - lost work time vacation time they used for treatment time doctors expenses etc. I have major depressive disorder high anxiety and mild agoraphobia. After seeing what treatment has to offer I will likely not seek it again and continue as is. (Long story short.)','Yes','6-25','m'),
