	(747,'No','Country 21','Maybe','Yes','No','No',32,'No','Maybe','No','Maybe','No','Somewhat difficult','No','No','No','No','Some of them',NULL,'No','No','Italians are somewhat behind for what concerns mental health care in the workplace.  Physical health care is very much accepted with a doctor that certifies your ailment.  Mental health is treated quite differently I believe because most people are willing to admit that physical ailments should be covered while mental ailments are almost considered non-existent in most respects.  ','No','6-25','Male'),
	(159,'Don''t know','Country 1','Maybe','Yes','No','Yes',25,'No','No','Don''t know','No','No','Very easy','No','Not sure','Don''t know','Yes','Some of them','Sometimes','No','Yes','Family history of depression.  Currently dealing with depression and anxiety as well as drug addition.Employer provides & pays premiums on insurance which covers therapy and prescriptions.  Employer allows work-from-home and unlimited PTO which makes episodes easier to control.I don''t speak of my problems to anyone at work except for the people that I consider friends and even then I don''t go into great detail.I would never bring up a mental health issue during an interview for fear of discrimination and rejection (and therefore greater depression).  One co-worker had serious anxiety problems and would not inform his team of episodes and was eventually let go for being unresponsive.','No','26-100','Male'),
