	(15,'Yes','Country 1','No','Yes','Some of them','No',29,NULL,'Maybe','Don''t know','Maybe','No','Somewhat easy','No','Not sure','Don''t know','Yes','Yes','Rarely','No','Yes','I have chronic low-level neurological issues that have mental health side effects. One of my supervisors has also experienced similar neurological problems so I feel more comfortable being open about my issues than I would with someone without that experience. ','No','26-100','female'),
	(1070,'No','Country 1','Maybe','Yes','Some of them','No',39,'No','Maybe','Don''t know','No','No','Don''t know','No','No','No','No','Some of them','Sometimes','Maybe','Yes','I''ve never heard of a workplace that would actually allow you to call off for mental health reasons. So many places require a doctor''s note for calling off sick. It''s all set up to make you feel worse if you can''t just suck it up. Thanks for working to change this!!!','Yes','6-25','Female'),
	(1158,'No','Country 1','No','Yes','No','No',30,'No','No','Don''t know','No','No','Don''t know','No','Yes','Don''t know','Yes','No','Rarely','No','Yes','People have often felt uncomfortable with my story while most of it happened a decade ago. I used to be quite open about it and have since kept it quietly tucked away. While I sometimes have waves of depression I have learned to cope with the affects.','No','6-25','m'),
