	(1049,'No','Country 3','No','Yes','Yes','Yes',39,'Yes','Maybe','Yes','No','Yes','Somewhat difficult','Yes','Yes','Yes','Yes','Yes','Sometimes','No','Yes','These result may be a tad confusing so a summary follows.* Currently self-employed so employer is me :)* Last place of employment was amazing when I first discovered I was bi-polar and helped me as long as I was there up to and including a mental health course for the whole team (although no mention why to others which was great).* I''ve never had a negative reaction yet but I know others who have.* I''ve been very lucky with company I keep which is why my experience is largely good.','Yes','1-5','Male'),
