	(1081,'Don''t know','Country 7','No','Yes','Yes','No',29,'No','No','Don''t know','Maybe','Yes','Very difficult','Don''t know','Not sure','Yes','Yes','Yes','Often','Maybe','Yes','Autism is a bitch for those living with it and living it. For the past years I''ve really been working hard to get myself (known) in the community. The people in the community that know can be counted on one hand. In general I''m not telling anyway unless it really matters and it would be a gain in some way or the other. Not because I don''t trust the community members close to me but because I don''t want to be that guy. And IMHO it doesn''t and shouldn''t matter but sadly some people are funky about that. Yet sometimes I wan''t to tell everyone what I''ve been through and share my lessons learned.','No','1-5','Male'),
