	(339,'Yes','Country 1','No','Yes','Yes','No',29,'No','Maybe','Yes','No','Yes','Very easy','Yes','Yes','Yes','No','Some of them',NULL,'No','No','I think a lot of our policy is based on a situation that occurred in the past 5 years. A very public mental illness happened with a coworker that unfortunately ended negatively. It was definitely a catalyst to talking about our options but the overall sentiment of it being OK to take time off talk with your supervisors etc. has always been there. It''s a great company.','No','26-100','male'),
	(419,'No','Country 1','Yes','Yes','No','Yes',55,'No','No','Don''t know','No','Don''t know','Don''t know','No','Yes','No','Yes','No','Sometimes','Maybe','Yes',NULL,'Yes','1-5','M'),
